import Typography from '@material-ui/core/Typography'
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';

const useStyles = makeStyles({
    TypographyStyle:{
        // fontweight: 800
    }

})

export default function Thirdrow() {
  const classes = useStyles();
    return(<>
            <Divider id="idofhr" variant="middle" />
        <Typography id="Typographyid">
           Delete Accounts
        </Typography>

             <Box display="flex">
             <Box p={1} flexGrow={0.73} >
             <Typography id="Typographyid2">
                          By deletinng your account your account you will losee all your data
             </Typography>
             </Box>              
             <Box p={1}>
             <Button>Delete account..</Button>
            </Box>
            </Box>
            <Divider id="idofhr" variant="middle" />
            <Box display="flex" p={1} flexGrow={9} >
                
            <Button variant="contained" color="primary">
            Primary
            </Button>
            
            </Box>
        </>
    );
}
